import IntlMessages from '../../util/IntlMessages';
import React from 'react';
const languageData = [
  {
    languageId: 'english',
    locale: 'en',
    name: <IntlMessages id="languageData.english" />,
    icon: 'us'
  },
  // {
  //   languageId: 'chinese',
  //   locale: 'zh',
  //   name: <IntlMessages id="languageData.chinese" />,
  //   icon: 'cn'
  // },
  // {
  //   languageId: 'spanish',
  //   locale: 'es',
  //   name: <IntlMessages id="languageData.spanish" />,
  //   icon: 'es'
  // },
  {
    languageId: 'french',
    locale: 'fr',
    name: <IntlMessages id="languageData.french" />,
    icon: 'fr'
  },
  // {
  //   languageId: 'italian',
  //   locale: 'it',
  //   name: <IntlMessages id="languageData.italian" />,
  //   icon: 'it'
  // },
  {
    languageId: 'tunisia',
    locale: 'ar',
    name: <IntlMessages id="languageData.arabic" />,
    icon: 'tn'
  }

];
export default languageData;
